function barChartParameters(data) {
  //console.log(data.columns);
  var chart_data = {
    "data": {
      "columns": data.columns,
      "type": "bar",
      "selection": {
        "enabled": true
      }
    },
    "grid": {
      "x": {
        "show": false
      },
      "y": {
        "show": true
      }
    },
    "tooltip": {
      "show": true,
      "grouped": false
    },
    "legend": {
      "show": false
    },
    "axis": {
      "x": {
        "label": "",
        "type": 'category',
        "position": 'outer-middle',
        tick: {
          rotate: 60,
          multiline: false
        },
        "categories": data.names
      },
      "y": {
      	"label": "",
        "position": 'outer-middle'
      }
    }
  };
  return chart_data;
};

