function getCategoryCounts(allData, datanames) {
  return allData.map(function(data) {
	  return {
		  	"names": ["counts"],
		    "columns": (range(data.columns.length)).map(function(i) {
		    	return [datanames[i], data.columns[0].length-1];
		    })
		  }  
  });
}

